    false,nt"url": null,nt"notes": "This point coverage of 517 points maps
    the locations of the 2001 & 2002 Mammal Inventories. The parks inventoried were
    Black Canyon of the Gunnison, Capitol Reef, Cedar Breaks, Curecanti NRA, Fossil
    Butte, Golden Spike, Hovenweep, Pipe Spring, and Timpanogos Cave. The points represent
    locations where inventories were conducted using the following inventory methods:
    random and/or targeted searches, trapping, traplines, mistnetting, acoustic surveys,
    track & scat surveys or incidental observations. These locations were GPSed using
    Garmin 12s, and using UTM NAD27. The data set was then reprojected to NAD83. Over
    the two years, a total of 119 individual species were recorded (52 species in '01
    and 67 species in '02).",nt"license_title": null,nt"extras": [{ntt"key":
